        void Application_Start()
        {
            // Code that runs on application startup

            //Application["UserName"] = null;
            
            aTimer.Elapsed += new System.Timers.ElapsedEventHandler(aTimer_Elapsed);
            // 设置引发时间的时间间隔 此处设置为１秒
            aTimer.Interval = 5000;
            aTimer.Enabled = true;
        }

        void aTimer_Elapsed(object sender, System.Timers.ElapsedEventArgs e)
        {
            //获取当前系统时间
            DateTime dt = System.DateTime.Now;
            ////将系统时间转换成字符串
            //string strTime = dt.ToString();
            ////长日期字符串
            //string strTime = dt.ToLongDateString();
            ////短日期字符
            //string strTime = dt.ToShortDateString();
            ////长时间字符串
            //string strTime = dt.ToLongTimeString();
            ////短时间字符串
            //string strTime = dt.ToShortTimeString();
            ////yyyyMMdd
            //string strTime = dt.ToString("yyyyMMdd");
            //yyyy-MM-dd HH:mm
            string timestr = dt.ToString("yy:MM:dd:HH:mm:ss");


            Write(timestr);
        }
        public void Write(string timestr)
        {
            FileStream fs = new FileStream("G:\\VMware_PC\\share\\opc.txt", FileMode.Create);
            //获得字节数组
            for (int i = 0; i < outstr.Length; i++) {
                byte[] data = System.Text.Encoding.Default.GetBytes("Unit #" + (i + 1).ToString() + "\t" + timestr + "\t" + outstr[i]+"\r\n");
                fs.Write(data, 0, data.Length);
            }
            //清空缓冲区、关闭流
            fs.Flush();
            fs.Close();
        }

